    false,nt"url": null,nt"notes": "Digital surfaces and thicknesses of selected
    hydrogeologic units of the Floridan aquifer system were developed to define an updated
    hydrogeologic framework as part of the U.S. Geological Survey Groundwater Resources
    Program. This feature class contains a gridded surface depicting the transmissivity
    of the Upper Floridan aquifer in feet squared per day.The well site data, from the
    TransmissivityWells.shp shapefile, containing 1487 transmissivity estimates, in
    units of feet squared per day, were used to produce this raster grid. The Geostatistical
    analyst inverse-distance weighting interpolation tool was used on the log10T field
    with weights from the weight field. Transmissivity estimates using test type, single-
    and multi-well aquifer tests (APT) were given a weight of 1.0 and specific capacity
    (SPC), a weight of 0.5. The map shows the estimated transmissivity based on interpolation
    of aquifer tests at the 1487 locations in units of log base 10 square feet per day.",nt"license_title":
